import { Movies } from "../constants/index";

const initialState = {
  movies: ["hello"],
};

const MoviesReducer = (state = initialState, action) => {
  switch (action.type) {
    case Movies.FETCH_MOVIES:
      console.log("fetch movies from an api");
      return state;
    default:
      return state;
  }
};

export default MoviesReducer;
